import React from 'react';

export default function Login() {
    return(
        <React.Fragment>
        <div className="container">
            <main>
                <form>
                    <input type="text" placeholder="Digite seu email..."></input>
                </form>
            </main>
        </div>
        </React.Fragment>
        
    );
}
